INSERT INTO `users` VALUES ('4', '张杰', '普通职员', '00000000029', '2004年参加第一届“我型我秀”获总冠军出道，2005年推出首张专辑《第一张》并凭借成名曲《北斗星的爱》获得全球华语榜中榜”年度传媒推荐大奖”等奖项[1] 。2008年举办首场个人演唱会，并凭借专辑《明天过后》首次获得最受欢迎男歌手奖[2] 。2010年，张杰发行专辑《这，就是爱》，开始拥有“It\'slove 这就是爱”个人专属演唱会品牌，并在韩国Mnet亚洲音乐盛典上获得“亚洲之星”奖[3] ，同年作为流行歌手代表受邀担任博鳌亚洲论坛表演嘉宾。2012年，张杰在北京人民大会堂开启了第一次巡演的历程。2013年首次登上央视春晚的舞台[4] 。2014年8月16日受邀参加南京第二届夏季青年奥林匹克运动会开幕式表演，与张靓颖、韩国演员金秀贤、俄罗斯歌手噶丽娅献唱开幕式主题歌《点亮未来》[5] 。2014年11月24日，在第42届全美音乐奖(AMA)上获“年度国际艺人奖(International Artist Award)”，是首位获得该奖的华语艺人', 'nr9EEUbEbYLEt79GynBKaw==', '2', '111114');
